function ItemList () {

   return (
   <React.Fragment>
   <Item/>
   <Item/>
   <Item/>
   </React.Fragment>
   );

}

function Item () {
    return (
        <div className="container"> 
       <ItemImage/>
       <ItemTitle/>
        </div>   
        )
}


function ItemTitle () {
    return  <div className="item-name">grinder</div>
}

function ItemImage () {
return <img src="https://images-na.ssl-images-amazon.com/images/G/01/DiscoTec/2022/MothersDay/GW/QuadImageCard/Desktop/Mom_25_GW_QuadImageCard_Desktop_372x232._SY232_CB623622619_.jpg"/>;
}

